import React from 'react';
import './About.css';

const About = () => {
  return (
    <section className="about" id="about">
      <div className="container">
        <h2 className="section-title">About Me</h2>
        <div className="about-content">
          <p>
            Insert a brief professional summary or personal statement here. Highlight your key strengths, 
            career aspirations, and what makes you unique in your field. This is your opportunity to make 
            a strong first impression and communicate your professional identity.
          </p>
          <p>
            You can also talk about your educational background, career trajectory, and any noteworthy 
            achievements or recognitions here. This section should give readers a clear picture of who you 
            are professionally and what you can offer.
          </p>
        </div>
      </div>
    </section>
  );
};

export default About;
